A set of photos of our military escort in Nijer back in 2022 during a dino excavation of Sauropods alongside @paulserenoofficial and his incredible team. The Nigerian government was kind enough to provide us with an escort of 66 armed guards as we worked in the remote, scorching Sahara desert. Without a doubt an unforgettable expedition with a amazing group of people / For @natgeo 
